import React, { Component } from "react";
import "@popperjs/core";
import 'bootstrap/dist/css/bootstrap.min.css';
import ImageInputBox from './imageInputBox';
import Radio from './radio';
import RadioGroup from './radioGroup';

class Reservation extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            name: new Date()

        };
    }
    render(){
        return(
            <div>
                <table className="table table-light table-striped-columns" style={{width:"1050px",height:"331.25px"}}>
                    <thead>
                            <tr>
                            <th scope="col">반려동물 이름</th>
                            <th scope="col">달구</th>
                            <th scope="col">이름</th>
                            <th scope="col">김미소</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <th scope="row">반려동물 종류</th>
                                <td>믹스견(장모종)</td>
                                <td>전화번호</td>
                                <td>010-xxxx-xxxx</td>
                            </tr>
                            <tr>
                                <th scope="row">반려동물 성별</th>
                                <td>여(중성화)</td>
                                <td>주소</td>
                                <td>부산광역시 동래구 000</td>
                            </tr>
                            <tr>
                                <th scope="row" rowSpan="3">메뉴선택</th>
                                <td colSpan="3">
                                    <tr>    
                                        <RadioGroup>
                                            <Radio name="species" value="ㄴmall" >
                                            중,소형견
                                            </Radio>
                                            <Radio name="species" value="big">
                                            대형견
                                            </Radio>
                                        </RadioGroup>
                                    </tr>
                                    <tr>
                                        <RadioGroup>
                                            <Radio name="cut" value="1" >
                                            가위컷
                                            </Radio>
                                            <Radio name="cut" value="2">
                                            기계컷
                                            </Radio>
                                            <Radio name="cut" value="3">
                                            스포팅
                                            </Radio>
                                            <Radio name="cut" value="4" >
                                            클리핑
                                            </Radio>
                                            <Radio name="cut" value="5" >
                                            부분미용
                                            </Radio>
                                        </RadioGroup>
                                    </tr>
                                    <tr>
                                        <RadioGroup>
                                            <Radio name="bath" value="bagic" >
                                            목욕
                                            </Radio>
                                            <Radio name="bath" value="healing">
                                            힐링스파
                                            </Radio>
                                            <Radio name="bath" value="carbonic acid">
                                            탄산스파
                                            </Radio>
                                        </RadioGroup>
                                    </tr>
                                    
                                </td>
                            </tr>
                        </tbody>
                </table>
            </div>

        )
    }
        
}


